Onun silinməsi {{SITENAME}} saytının verilənlər bazası əməliyyatlarını poza bilər;
ehtiyatla davam edin.

alreadyrolled:
[[User:$2|$2]] ([[User talk:$2|müzakirə]]{{int:pipe-separator}}[[Special:Contributions/$2|{{int:contribslink}}]]) tərəfindən [[:$1]] səhifəsinə edilmiş dəyişikliyi geri qaytarmaq mümkün deyil;
hansısa istifadəçi artıq dəyişikliyi geri alıb və ya səhifəni redaktə edib.

Səhifəyə son dəyişiklik [[User:$3|$3]] ([[User talk:$3|müzakirə]]{{int:pipe-separator}}[[Special:Contributions/$3|{{int:contribslink}}]]) tərəfindən edilib.

sessionfailure:
Deyəsən, giriş sessiyanızla bağlı problem var;
Sessiyanın təhlükəsizliyi üçün bu əməliyyat ləğv edildi.
Zəhmət olmasa, formanı yenidən göndərin.
